INSERT INTO `fd_poll` VALUES ('nextmovienightmovies','8nBB73iVkksVpeEFEFMnwUGz','NextMovieNight Movies','**IMPORTANT!!**\nWhen changing your entries, the \"save\" button is all the way to the RIGHT of the chart. Changes will not take effect until you click it.\n\n![](http://www.donniehardin.com/images/framadateSaveChange.png)\n\n\nHere we can vote on the two movies we plan to watch on our next movie night. \nAs always, see bottom of page for latest comments.\n\nIf you think another movie should be added to the list, please leave a comment and I will add it!\n\nPlace a GREEN CHECK on the TWO movies you want to see most, and a PARENTHESIS CHECK on your \"runner up\" picks.\n\nPlace a RED X on movies you don\'t want to see for any reason (i.e. seen it very recently, not in the mood, etc)\n\nSee our other poll for deciding which night for our next movienight. Link below:\n\nhttp://www.donniehardin.com/framadate/studs.php?poll=nextmovienightSepOct2018','donnie','dch84121@gmail.com','2018-09-17 16:12:53','2019-03-16 16:12:41','A',1,0,0,1,0,NULL,NULL,0),('nextmovienightSepOct2018','JD2eB3zy6dNK6RcwiBg8egCB','Next Movienight','**IMPORTANT!!**\nWhen changing your entries, the \"save\" button is all the way to the RIGHT of the chart. Changes will not take effect until you click it.\n\n![](http://www.donniehardin.com/images/framadateSaveChange.png)\n\n\nThis poll has been created to assess the availabilty and interest of a movie night to be held in Sept/Oct at either Tarls place, or Donnie\'s.\n\nTo see the poll where we will decide which movies we are interested in, go to:\n\nhttp://www.donniehardin.com/framadate/studs.php?poll=nextmovienightmovies','donnie','dch84121@gmail.com','2018-09-17 15:51:18','2019-03-16 15:51:18','D',1,0,0,1,0,NULL,NULL,0),('splatterflix','ZcVVlGRcbRTOSbSmC4Od346e','SPLATTERFLIX 2018','**IMPORTANT!!**\nWhen changing your entries, the \"save\" button is all the way to the RIGHT of the chart. Changes will not take effect until you click it.\n\n![](http://www.donniehardin.com/images/framadateSaveChange.png)\n\nSplatterflix 2018 Planner\n\nPlace a check on the film/times you plan on seeing. Pay a attention to the times since you cannot see two films at the same time!\n\nPlace a (parenthesis check) on movie/time that you think you might go to but not sure if you will attend\n\nPlace a red check on movie/times where you are definately unable to attend (out of town, etc.)\n\nNote that you have the ability to modify the checks of o any other person (in case they ask you to do it on their behalf)\n\nFeel free to add any comments, proposals, etc.','donnie','dch84121@gmail.com','2018-09-17 02:52:53','2019-03-16 02:52:53','D',1,0,0,1,0,NULL,NULL,0),('switchonline','5ul9LqiZVtIV1X7jNBlQd6Dm','1 year switch online','who is going to sub for the switch online service for a year?\n','Yow','dch84121@gmail.com','2018-09-17 18:47:14','2019-03-16 18:47:11','A',2,0,0,1,0,NULL,NULL,0),('uJVsQxkzfTWxyPaK','uJVsQxkzfTWxyPaKVWeXEwB6','does Scrappy-doo suck?','','donnie','dch84121@gmail.com','2018-10-04 12:43:48','2019-04-02 12:43:42','A',2,0,0,1,0,NULL,NULL,0);
